function renderfreeFieldVertical(answers, taskId, dropBackground, extraSets) {
  const taskWrapper = document.getElementById(`${taskId}`)
  createTemplateBaseMarkup(taskWrapper, createBaseMarkup)

  const dropZone = taskWrapper.querySelector('.freeFieldVertical_drop')

  const dragBoxWrapper = taskWrapper.querySelector(
    '.freeFieldVertical_dragPlaceWrapper'
  )

  const {
    topBtn,
    bottomBtn,
    sliderBox: answersWrapper,
  } = renderVerticalSliderWithButtonsMarkup(
    dragBoxWrapper,
    'freeFieldVertical_sliderContent'
  )

  renderCheckPanel(taskWrapper, false)
  const { btnReset } = getCheckPanelElements(taskWrapper)

  let draggingItem
  let elemBelow
  let zIndex = 0

  let sliderSet = {
    sliderItemHeight: 0,
    sliderSize: 0,
    sliderWrapperSize: answersWrapper.offsetParent.clientHeight,
    sliderShift: 0,
  }

  taskWrapper.addEventListener('pointerdown', mouseDown)
  btnReset.addEventListener('click', resetTask)

  topBtn.addEventListener('click', LeftClick)
  bottomBtn.addEventListener('click', RightClick)

  if (dropBackground.imgSrc) {
    dropZone.style.backgroundImage = `url(${dropBackground.imgSrc})`
    dropZone.style.backgroundSize = dropBackground.size
  }

  fillAnswerField()
  getVerticalBlocksSizes(sliderSet, answersWrapper)
  showArrows(sliderSet, topBtn, bottomBtn)

  function fillAnswerField() {
    shuffleCards(answers).forEach(item => {
      let answer = document.createElement('div')
      answer.classList.add('freeFieldVertical_answer')
      answer.innerHTML = item.imgSrc
      getStartRotation(answer)
      if (item.size) {
        answer.style.height = item.size
        answer.style.width = item.size
      } else {
        answer.style.height = '100px'
        answer.style.width = '100px'
      }
      answersWrapper.append(answer)
    })
  }

  function resetTask() {
    let pics = taskWrapper.querySelectorAll('.freeFieldVertical_answer')
    pics.forEach(item => {
      changeStyles(item)
      getRandomPositionToCard(item)
      item.style.position = 'initial '

      getStartRotation(item)
      answersWrapper.append(item)
    })
    sliderSet.sliderShift = 0
    sliderResetState(sliderSet, answersWrapper, 'vertical')
    getVerticalBlocksSizes(sliderSet, answersWrapper)
    showArrows(sliderSet, topBtn, bottomBtn)
    zIndex = 0
  }

  function mouseDown(event) {
    if (event.button !== 0) return

    getDraggingItem(event.target)

    function getDraggingItem(element) {
      if (element.closest('.freeFieldVertical_answer')) {
        if (element.tagName === 'svg') {
          element.parentElement.style.visibility = 'hidden'
          let Item = document.elementFromPoint(event.clientX, event.clientY)
          if (Item.tagName === 'path') {
            draggingItem = Item.closest('.freeFieldVertical_answer')
          } else {
            if (Item.closest('.freeFieldVertical_answer')) {
              getDraggingItem(Item)
            } else {
              draggingItem = null
            }
          }
          element.parentElement.style.visibility = 'visible'
        } else if (element.classList.contains('freeFieldVertical_answer')) {
          element.style.visibility = 'hidden'
          let Item = document.elementFromPoint(event.clientX, event.clientY)
          if (Item.tagName === 'path') {
            draggingItem = Item.closest('.freeFieldVertical_answer')
          } else {
            if (Item.closest('.freeFieldVertical_answer')) {
              getDraggingItem(Item)
            } else {
              draggingItem = null
            }
          }
          element.style.visibility = 'visible'
        } else if (element.tagName === 'path') {
          draggingItem = element.closest('.freeFieldVertical_answer')
        }
      } else {
        return
      }
    }

    if (!draggingItem) {
      return
    }

    draggingItem.style.touchAction = 'none'
    zIndex++
    draggingItem.style.zIndex = zIndex

    event.target.style.cursor = 'grabbing'
    draggingItem.addEventListener('pointerup', onpointerup)
    document.addEventListener('pointermove', onMouseMove)

    // elemBelow = document.elementFromPoint(event.clientX, event.clientY);
    // draggingItem.style.visibility = "visible";
    //if(event.target.closest("path")||!event.target.closest("path"))
    //if (!event.target.closest("path")) return;

    //console.log(draggingItem)
    // находим индекс элемента, который берем в списке отрисованных. answersWrapper - контейнер для перетаскиваемых элементов
    const findIdx = [...answersWrapper.children].findIndex(
      el => el === draggingItem
    )

    let shiftX = event.clientX - draggingItem.getBoundingClientRect().left
    let shiftY = event.clientY - draggingItem.getBoundingClientRect().top

    // ЛИМИТЫ КООРДИНАТ ОГРАНИЧИВАЮЩИЕ ВЫЛЕТ ПЕРЕТАСКИВАЕМОГО ЭЛЕМЕНТА ЗА БЛОК

    //  (ПО УМОЛЧАНИЮ interact_zadanie - РОДИТЕЛЬ ВАШЕГО БЛОКА)
    let limits = {
      top: taskWrapper.offsetTop,
      right: taskWrapper.offsetWidth + taskWrapper.offsetLeft,
      bottom: taskWrapper.offsetHeight + taskWrapper.offsetTop,
      left: taskWrapper.offsetLeft,
    }

    function moveAt(pageX, pageY) {
      draggingItem.style.left = pageX - shiftX + 'px'
      draggingItem.style.top = pageY - shiftY + 'px'
    }

    let clickWithoutMove = true

    function onMouseMove(event) {
      if (clickWithoutMove) {
        draggingItem.style.position = 'absolute'
        draggingItem.style.zIndex = zIndex
        taskWrapper.appendChild(draggingItem)
      }
      let newLocation = {
        x: limits.left,
        y: limits.top,
      }
      if (event.pageX > limits.right) {
        newLocation.x = limits.right
      } else if (event.pageX > limits.left) {
        newLocation.x = event.pageX
      }
      if (event.pageY > limits.bottom) {
        newLocation.y = limits.bottom
      } else if (event.pageY > limits.top) {
        newLocation.y = event.pageY
      }

      clickWithoutMove = false
      moveAt(newLocation.x, newLocation.y)

      /*if (!event.composedPath().includes(draggingItem)) {
        window.addEventListener('pointerup', moveOut)
        console.log('moveOut')
      }
      if (event.composedPath().includes(draggingItem)) {
        window.removeEventListener('pointerup', moveOut)
        console.log('moveOut return')
      }*/

      draggingItem.style.visibility = 'hidden'
      elemBelow = document.elementFromPoint(event.clientX, event.clientY)
      draggingItem.style.visibility = 'visible'

      if (!elemBelow) return
    }
    document.addEventListener('pointermove', onMouseMove)
    draggingItem.addEventListener('pointerup', onpointerup)

    function moveOut(e) {
      dragAppend(answersWrapper, draggingItem, findIdx)
      window.removeEventListener('pointerup', moveOut)
      document.removeEventListener('pointermove', onMouseMove)
      draggingItem.removeEventListener('pointerup', onpointerup)
    }

    function onpointerup(e) {
      document.removeEventListener('pointermove', onMouseMove)
      event.target.style.cursor = 'grab'
      if (clickWithoutMove) {
        rotateImg(draggingItem)
        draggingItem.removeEventListener('pointerup', onpointerup)
      } else {
        if (elemBelow && elemBelow.closest('.freeFieldVertical_drop')) {
          elemBelow = elemBelow.closest('.freeFieldVertical_drop')
          //draggingItem.style.zIndex = 0
          elemBelow.append(draggingItem)
        } else {
          dragAppend(answersWrapper, draggingItem, findIdx)
          draggingItem.style.position = 'initial'
        }
      }
      draggingItem.removeEventListener('pointerup', onpointerup)

      elemBelow = null

      sliderSet.sliderSize = answersWrapper.scrollHeight
      showArrows(sliderSet, topBtn, bottomBtn)
      draggingItem.removeEventListener('pointerup', onpointerup)
      draggingItem = null
    }
  }

  function LeftClick() {
    onBtnTopClick(sliderSet, answersWrapper, topBtn, bottomBtn)
  }

  function RightClick() {
    onBtnBottomClick(sliderSet, answersWrapper, topBtn, bottomBtn)
  }

  /*function onBtnTopClick(sliderSet, dragContainer, leftButton, rightButton) {
    getVerticalBlocksSizes(sliderSet, dragContainer)

    if (sliderSet.sliderShift < 0) {
      sliderSet.sliderShift += sliderSet.sliderItemHeight
      dragContainer.style.top = `${sliderSet.sliderShift}px`
    }
    showArrows(sliderSet, leftButton, rightButton)
  }*/

  function rotateImg(draggingItem) {
    let angle = 90
    if (draggingItem.style.transform) {
      if (draggingItem.style.transform === 'rotate(0deg)') {
        angle = 90
      } else if (draggingItem.style.transform === 'rotate(90deg)') {
        angle = 180
      } else if (draggingItem.style.transform === 'rotate(180deg)') {
        angle = 270
      } else {
        angle = 0
      }
    }

    draggingItem.style.transform = `rotate(${angle}deg)`
  }

  function getStartRotation(element) {
    const degrees = [0, 90, 180, 270]
    let angle = degrees[Math.floor(Math.random() * degrees.length)]
    element.style.transform = `rotate(${angle}deg)`
  }

  function createBaseMarkup() {
    return `
  <div class="freeFieldVertical_wrapper task_wrapper">
        <div class="freeFieldVertical_drop"></div>
        <div class="freeFieldVertical_dragPlaceWrapper"></div>
      </div>
    `
  }
}
